const Coin =  ({ name,image,symbol,price,volume }) => {
    return (
        <CoinContainer>
            <CoinRow>
                <Coin>
                    <img src={image}  alt="Crypto" />
                    <h1>{name}</h1>
                    <CoinSymbol>{symbol}</CoinSymbol>
                </Coin>
                <CoinData>
                    <CoinPrice>${price}</CoinPrice>
                    <CoinVolume>${volume.toLocaleString()}</CoinVolume>
                    {priceCha}
                </CoinData>
            </CoinRow>
        </CoinContainer>
    )
}

export default Coin;
